import * as PCA from 'ml-pca';
import * as R from 'ramda';
import {getNumbersOfDataset, getNumberOfColumn} from './dataset-operation.js';

const PrincipalComponentAnalysis = new PCA.PCA(getNumbersOfDataset);
const generateRandom = R.pipe(
    Math.random,
    R.multiply(10),
);
const generatePoint = R.pipe(
    R.identity(),
    R.times(generateRandom),
)(getNumberOfColumn);
const prediction = PrincipalComponentAnalysis.predict([generatePoint]).to1DArray();

const CumulativeVariance = PrincipalComponentAnalysis.getCumulativeVariance();
const EingenValues = PrincipalComponentAnalysis.getEigenvalues();
const EingenVectors = PrincipalComponentAnalysis.getEigenvectors();
const getExplainedVariance = PrincipalComponentAnalysis.getExplainedVariance();
const getLoadings = PrincipalComponentAnalysis.getLoadings();
const getStandardDeviations = PrincipalComponentAnalysis.getStandardDeviations();

export {
    PrincipalComponentAnalysis,
    prediction,
    CumulativeVariance,
    EingenValues,
    EingenVectors,
    getLoadings,
    getExplainedVariance,
    getStandardDeviations,
};

import fs from 'node:fs';
import * as R from 'ramda';
import {Path, encode} from './common.js';

const data = R.pipe(
    fs.readFileSync,
)(Path, encode);

const transformCSVText = R.pipe(
    R.pipe(
        R.split('\n'),
        R.map(
            R.pipe(
                R.split(','),
                R.map(R.trim),
            ),
        ),
    ),
)(data);

export {transformCSVText};

import * as R from 'ramda';
import {transformCSVText} from './csv-to-array.js';

const nbPiocheAleatoireDataset = 10;

const datasetAvecColonne = transformCSVText;

const dataset = R.pipe(
    R.drop(1),
    R.dropLast(1),
)(datasetAvecColonne);

const findClassColumnIndex = R.pipe(
    R.indexOf('Class'),
)(datasetAvecColonne[0]);

const getClassOfIndex = R.pipe(
    R.nth(R.__, datasetAvecColonne),
    R.ifElse(R.pipe(
            R.length(),
            R.equals(1),
        ),
        R.or(R.isEmpty(), R.isNil()),
        R.nth(findClassColumnIndex)),
);

const classDataset = R.pipe(
    R.length(),
    R.subtract(R.__, 1),
    R.times(getClassOfIndex),
    R.drop(1),
    R.uniq(),
)(datasetAvecColonne);

const nbClassDataset = R.length(classDataset);

const nbElementDataset = R.length(dataset);

const randomInt = R.pipe(
    Math.random,
    R.multiply(nbElementDataset),
    Math.floor,
);

const getRandomDatasetElement = R.pipe(
    randomInt,
    R.nth(R.__, dataset),
);
const getRandomDatasetType = R.pipe(
    getRandomDatasetElement,
    R.last(),
);

const tableauObservationEquilibre = R.repeat(nbPiocheAleatoireDataset, nbClassDataset);

const tableauObservationReel = R.pipe(
    R.multiply(nbPiocheAleatoireDataset),
    R.times(getRandomDatasetType),
    R.sort((a, b) => a.localeCompare(b)),
    R.groupWith(R.equals()),
    R.flatten(),
    R.countBy(R.identity()),
    R.values(),
)(nbClassDataset);

const getNumbersOfDataset = R.pipe(
    R.length(),
    R.times(R.pipe(
        R.nth(R.__, dataset),
        R.map(Number),
        R.take(findClassColumnIndex),
        R.concat(R.pipe(
            R.length(),
            R.subtract(findClassColumnIndex),
            R.multiply(-1),
            R.drop(dataset),
        )(dataset))),
    ),
)(dataset);

const getNumberOfColumn = R.pipe(
    R.head(),
    R.length(),
    R.subtract(1),
    R.multiply(-1),
)(dataset);
export {tableauObservationEquilibre, tableauObservationReel, nbClassDataset, getNumbersOfDataset, getNumberOfColumn};

import {spawn} from 'node:child_process';
import gulp from 'gulp';

const {watch, series} = gulp;

let myProcess = null;

const watcher = async () => {
    watch(['./**/*.js'], series(stop, start));
};

const start = async () => {
    myProcess = spawn('node', ['index.js'], {stdio: 'inherit'});
};

const stop = async () => {
    if (myProcess) {
        await myProcess.kill();
        myProcess = null;
    }
};

const defaultRun = series(start, watcher);

export default defaultRun;
export {watcher, defaultRun};
